  summary: >-
    An attribute that is attached to properties of a <xref href="osu.Framework.Graphics.Drawable" data-throw-if-not-resolved="false"></xref> component to indicate that the value of the property should be retrieved from a dependency cache.

    Properties marked with this attribute must be private and have a setter.
  remarks: The value of the property is resolved upon <xref href="osu.Framework.Graphics.Drawable.Load(osu.Framework.Timing.IFrameBasedClock%2cosu.Framework.Allocation.IReadOnlyDependencyContainer%2cSystem.Boolean)" data-throw-if-not-resolved="false"></xref> for the target <xref href="osu.Framework.Graphics.Drawable" data-throw-if-not-resolved="false"></xref>.
  example: []
  syntax:
    content: >-
      [MeansImplicitUse(ImplicitUseKindFlags.Assign)]

